import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import StarWarProvider from './context/StarWarProvider';

ReactDOM
  .createRoot(document.getElementById('root'))
  .render(<App />)
    .render(
      <StarWarProvider>
        <App />
      </StarWarProvider>,
    );
